import { useState } from 'react';
import styled from 'styled-components';

import { HuePicker } from 'react-color';

const SettingsSpaceShipContainer = styled.div`
  width: 90%;
  margin: 8px auto 0;

  border: 2px solid #ffffff;
  border-radius: 10px;
`;

const SettingsSpaceShip = () => {
  const [color, setColor] = useState('green');

  return (
    <>
      <p
        style={{
          fontSize: 18,
          fontWeight: 700,
          color: '#FFC700',
          textAlign: 'center',
          letterSpacing: 1,
        }}
      >
        Your spaceship:
      </p>
      <SettingsSpaceShipContainer>
        <p
          style={{
            marginTop: 8,
            fontSize: 16,
            fontWeight: 700,
            textAlign: 'center',
            letterSpacing: 1,
            textTransform: 'uppercase',
          }}
        >
          settings
        </p>
        <HuePicker
          width="100%"
          color={color}
          on
          onChangeComplete={(color) => {
              console.log(123)
            setColor(color);
          }}
        ></HuePicker>
      </SettingsSpaceShipContainer>
    </>
  );
};

export default SettingsSpaceShip;
